ear in the LED Menu."}]},"showMoreText":{"simpleText":"Poka wicej"},"showLessText":{"simpleText":"Poka mniej"}}}]}},"veType":124975,"targetId":"engagement-panel-structured-description","visibility":"ENGAGEMENT_PANEL_VISIBILITY_HIDDEN","loggingDirectives":{"trackingParams":"CB0Q040EGAIiEwiPu_6p3v_6AhWbgfQHHXBYCeg=","visibility":{"types":"12"},"enableDisplayloggerExperiment":true}}},{"engagementPanelSectionListRenderer":{"panelIdentifier":"comment-item-section","header":{"engagementPanelTitleHeaderRenderer":{"title":{"runs":[{"text":"Komentarze"}]},"contextualInfo":{"runs":[{"text":"6"}]},"menu":{"sortFilterSubMenuRenderer":{"subMenuItems":[{"title":"Najlepsze komentarze","selected":true,"serviceEndpoint":{"clickTrackingParams":"CBwQ48AHGAAiEwiPu_6p3v_6AhWbgfQHHXBYCeg=","commandMetadata":{"webCommandMetadata":{"sendPost":true,"apiUrl":"/youtubei/v1/next"}},"continuationCommand":{"token":"Eg0SCzlBS2tNcmg5X3R3GAYyOCIRIgs5QUtrTXJoOV90dzAAeAIwAUIhZW5nYWdlbWVudC1wYW5lbC1jb21tZW50cy1zZWN0aW9u","request":"CONTINUATION_REQUEST_TYPE_WATCH_NEXT","command":{"clickTrackingParams":"CBwQ48AHGAAiEwiPu_6p3v_6AhWbgfQHHXBYCeg=","showReloadUiCommand":{"targetId":"engagement-panel-comments-section"}}}},"trackingParams":"CBwQ48AHGAAiEwiPu_6p3v_6AhWbgfQHHXBYCeg="},{"title":"Od najnowszych","selected":false,"serviceEndpoint":{"clickTrackingParams":"CBsQ48AHGAEiEwiPu_6p3v_6AhWbgfQHHXBYCeg=","commandMetadata":{"webCommandMetadata":{"sendPost":true,"apiUrl":"/youtubei/v1/next"}},"continuationCommand":{"token":"Eg0SCzlBS2tNcmg5X3R3GAYyOCIRIgs5QUtrTXJoOV90dzABeAIwAUIhZW5nYWdlbWVudC1wYW5lbC1jb21tZW50cy1zZWN0aW9u","request":"CONTINUATION_REQUEST_TYPE_WATCH_NEXT","command":{"clickTrackingParams":"CBsQ48AHGAEiEwiPu_6p3v_6AhWbgfQHHXBYCeg=","showReloadUiCommand":{"targetId":"engagement-panel-comments-section"}}}},"trackingParams":"CBsQ48AHGAEiEwiPu_6p3v_6AhWbgfQHHXBYCeg="}],"icon":{"iconType":"SORT"},"accessibility":{"accessibilityData":{"label":"Sortuj komentarze"}},"trackingParams":"CBoQgdoEIhMIj7v-
